$(document).ready(function() {

	var treeName,
			treeSize,
			treePrice;

	function priceCalculation(treeName, treeSize) {
		if (treeName == 'ingrid' && treeSize == '0,9')
			treePrice = '840'
		else if (treeName == 'ingrid' && treeSize == '1,2')
			treePrice = '990'
		else if (treeName == 'ingrid' && treeSize == '1,4')
			treePrice = '1890'
		else if (treeName == 'ingrid' && treeSize == '1,6')
			treePrice = '2350'
		else if (treeName == 'ingrid' && treeSize == '1,8')
			treePrice = '3390'
		else if (treeName == 'ingrid' && treeSize == '2,2')
			treePrice = '4570'
		else if (treeName == 'monika' && treeSize == '0,9')
			treePrice = '890'
		else if (treeName == 'monika' && treeSize == '1,6')
			treePrice = '2590'
		else if (treeName == 'monika' && treeSize == '1,8')
			treePrice = '3600'
		else if (treeName == 'lux-green' && treeSize == '1,6')
			treePrice = '2710'
		else if (treeName == 'lux-green' && treeSize == '1,8')
			treePrice = '4110'
		else if (treeName == 'lux' && treeSize == '1,6')
			treePrice = '2890'
		else if (treeName == 'lux' && treeSize == '1,8')
			treePrice = '2390'
		else if (treeName == 'lux' && treeSize == '2,2')
			treePrice = '6170'

		return treePrice;
	}


	//Scroll to top page
	$('.footer__logo').on('click',function() {
		$('html, body').animate({scrollTop: 0}, 500);
		return false;
	});

	//to callback scroll
	$('a.transition').on('click', function() {
		var scroll_el = $(this).attr('href');

		if ($(scroll_el).length != 0)
			$('html, body').animate({scrollTop: $(scroll_el).offset().top}, 500);

		return false;
	});

	//Phone mask
	$('[name="phone"]').inputmask({"mask": "+7 (999) 999-99-99"});

	//Selection size
	$('[data-tree-size]').on('click', function() {
		treeName = $(this).data('tree-name');
		treeSize = $(this).data('tree-size');

		$(this).parent().find('.catalog__s-item').removeClass('catalog__s-item--active');
		$(this).addClass('catalog__s-item--active');


		priceCalculation(treeName, treeSize);

		$(this).parent().parent().parent().find('.catalog__new span').html(treePrice);

		if (treeName == 'ingrid' && treeSize == '1,2')
			$(this).parent().parent().parent().find('.catalog__del span').html(parseInt(treePrice) + 410);
		else
			$(this).parent().parent().parent().find('.catalog__del span').html(parseInt(treePrice) + 600);
	});

	//Modal
	$('.catalog__button').on('click', function() {
		treeName = $(this).data('tree-name');

		if (treeName == 'ingrid')
			treeName = 'Ель Ингрид зелёная'
		else if (treeName == 'monika')
			treeName = 'Ель Моника приснеженная'
		else if (treeName == 'lux-green')
			treeName = 'Ель Люкс зелёная'
		else if (treeName == 'lux')
			treeName = 'Ель Люкс приснеженная'

		treeSize = $(this).parent().parent().find('.catalog__s-item--active').data('tree-size');
		treePrice = $(this).parent().find('.catalog__new span').html();
		$('.popup__buy').arcticmodal();
	});

	//Send form
	$('[type="submit"]').on('click', function(e) {
		e.preventDefault();

		var form = $(this).closest('form'),
				formName = form.data('form-name')
				inpName = form.find('[name="name"]'),
				valName = inpName.val();
				inpPhone = form.find('[name="phone"]'),
				valPhone = inpPhone.val();

		if (valName <= 0)
			alert('Введите имя')
		else if (valPhone <= 0)
			alert('Введите телефон')
		else {
			$.ajax({
				type: 'POST',
				url: 'send.php',
				data: {
					'form': formName,
					'name': valName,
					'phone': valPhone,
					'treeName': treeName,
					'treeSize': treeSize,
					'treePrice': treePrice
				},
				success: function(data) {
					alert('Ваша заявка принята');
					inpName.val('');
					inpPhone.val('');
				}
			});
		}
	});

});
